import React from 'react'
import 'chart.js/auto'
import { Line, defaults } from 'react-chartjs-2'

//defaults.global.tooltips.enabled = false
//defaults.global.legend.position = 'bottom'

const BarChart = () => {
  return (
    <div>
      <Line
        data={{
          labels: [0, 1, 2, 3, 4, 5],
          datasets: [
            {
              label: '# of votes',
              data: [12, 19, 3, 5, 2, 3],
            },
          ],
        }}
      />
    </div>
  )
}

export default BarChart
